import React, { useRef } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  height: 100vh;
  overflow-y: scroll;
  scroll-behavior: smooth;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
  background-image: url('https://example.com/background-image.jpg'); /* Replace with your background image URL */
  background-size: cover;
  background-position: center;
`;

const Section = styled.section`
  margin: 40px 0;
`;

const ImageLink = styled.a`
  display: block;
  margin: 20px 0;
`;

const AuthLinks = styled.div`
  margin-top: 20px;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Button = styled.button`
  padding: 10px 20px;
  margin: 10px;
  font-size: 18px;
  border: none;
  border-radius: 5px;
  background-color: #007bff; /* Customize the button background color */
  color: white;
  cursor: pointer;
`;

const Default = () => {
  const section1Ref = useRef(null);
  const section2Ref = useRef(null);

  const scrollToSection = (ref) => {
    if (ref && ref.current) {
      ref.current.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <Container>
      <h1 style={{ fontSize: '36px', marginBottom: '20px' }}>Task Manager</h1>
      <p style={{ fontSize: '18px', marginBottom: '40px' }}>
        Manage your tasks efficiently with our easy-to-use Task Manager.
      </p>

      <AuthLinks>
        <Button onClick={() => scrollToSection(section1Ref)}>Scroll to Section 1</Button>
        <Button onClick={() => scrollToSection(section2Ref)}>Scroll to Section 2</Button>
        <a href="/login" style={{ fontSize: '18px', margin: '10px', textDecoration: 'none', color: 'white' }}>Login</a>
        <a href="/signup" style={{ fontSize: '18px', margin: '10px', textDecoration: 'none', color: 'white' }}>Sign Up</a>
      </AuthLinks>

      <Section ref={section1Ref}>
        <h2>Section 1</h2>
        <p>Content for Section 1 goes here.</p>
        <ImageLink href="https://images.unsplash.com/photo-1555685812-4b943f1cb0eb" target="_blank">
          <img src="https://images.unsplash.com/photo-1555685812-4b943f1cb0eb" alt="Image 1" />
        </ImageLink>
      </Section>

      <Section ref={section2Ref}>
        <h2>Section 2</h2>
        <p>Content for Section 2 goes here.</p>
        <ImageLink href="https://images.unsplash.com/photo-1555685812-4b943f1cb0eb" target="_blank">
          <img src="https://images.unsplash.com/photo-1555685812-4b943f1cb0eb" alt="Image 2" />
        </ImageLink>
      </Section>
    </Container>
  );
};

export default Default;
